import React from "react";
import { Link } from "react-router-dom";

const baleia = () => (
    <div className="info">
        <h1>Baleia Fin</h1>
        <p>A baleia-fin é um dos maiores animais do planeta, podendo atingir mais de 27 metros de comprimento e pesar mais de 70 toneladas. Elas têm uma aparência característica, com uma cabeça grande e larga, uma barbatana dorsal longa e curva e uma cauda achatada.
            As baleias-fins são encontradas em águas temperadas e frias do mundo todo, e se alimentam de pequenos crustáceos e plâncton. Elas são animais migratórios e podem percorrer grandes distâncias ao longo do ano.
            Infelizmente, a caça excessiva ao longo do século XX reduziu drasticamente a população de baleias-fins, que atualmente é considerada uma espécie ameaçada de extinção. A proteção das baleias-fins é importante para manter o equilíbrio dos ecossistemas marinhos e a preservação da diversidade biológica.</p>
    </div>
);

export default baleia;
